'{
  "data": {"name": "dataset"},
  "spacing": {"row": 12},
  "title": {
    "text": "Players shown by % selected and Total Points",
    "anchor": "middle",
    "color": "#454545",
    "baseline": "bottom"
  },

  "facet": {
    "row": {
      "field": "Name",
      "type": "nominal",
      "header": {
        "title": null,
        "labelAngle": 0,
        "labelPadding": 10,
        "titlePadding": 0,
        "labelAlign": "left",
        "labelLimit": 80
      },
      "sort": {
        "field": "Total pts by GW",
        "order": "descending"
      }
    }
  },
  "spec": {
    "height": 25,
    "view": {"stroke": null},
    "layer": [
      {
        "mark": {
          "type": "arc",
          "radius": 18,
          "color": "#f38732",
          "xOffset": -180
        },
        "encoding": {
          "theta": {
            "field": "sel%",
            "type": "quantitative",
            "scale": {
              "domain": [0, 100]
            },
            "aggregate": "sum"
          }
        }
      },
      {
        "transform": [
          {
            "calculate": "100",
            "as": "_smallC"
          }
        ],
        "mark": {
          "type": "arc",
          "outerRadius": 18,
          "innerRadius": 17.3,
          "color": "#f38732",
          "xOffset": -180
        },
        "encoding": {
          "theta": {
            "field": "_smallC",
            "type": "quantitative",
            "aggregate": "max"
          }
        }
      },
      {
        "transform": [
          {
            "calculate": "datum[''sel%'']/100",
            "as": "_label"
          },
          {
            "calculate": "45",
            "as": "_offset"
          }
        ],
        "mark": {
          "type": "text",
          "radius": 0,
          "size": 12,
          "fontWeight": 600,
          "color": "#000000",
          "xOffset": -180
        },
        "encoding": {
          "text": {
            "field": "_label",
            "format": ",.0%"
          },
          "theta": {
            "field": "_offset",
            "type": "quantitative"
          }
        }
      },
      {
        "mark": {
          "type": "bar",
          "tooltip": true,
          "height": {"band": 1.2},
          "color": "#f38732"
        },
        "encoding": {
          "x": {
            "field": "Total pts by GW",
            "type": "quantitative",
            "aggregate": "sum",
            "axis": {
              "title": null,
              "labels": false,
              "ticks": false
            }
          }
        }
      },
      {
        "mark": {
          "type": "text",
          "tooltip": true,
          "color": "black",
          "size": 14,
          "xOffset": -15
        },
        "encoding": {
          "text": {
            "field": "Total pts by GW"
          },
          "x": {
            "field": "Total pts by GW",
            "type": "quantitative",
            "aggregate": "sum",
            "axis": {
              "title": null,
              "labels": false,
              "ticks": false
            }
          }
        }
      }
    ],
    "encoding": {
      "y": {
        "field": "Name",
        "axis": {
          "title": null,
          "labels": false,
          "ticks": false
        }
      },
      "opacity": {
        "condition": {
          "test": {
            "field": "__selected__",
            "equal": "off"
          },
          "value": 0.1
        },
        "value": 1
      }
    }
  },
  "resolve": {
    "scale": {"y": "independent"}
  }
}'

